// I got my radio Group button from this website:
// https://mui.com/material-ui/react-radio-button/

import "./App";
import { useState } from "react";
import Radio from '@mui/material/Radio';
import RadioGroup from '@mui/material/RadioGroup';
import FormControlLabel from '@mui/material/FormControlLabel';
import FormControl from '@mui/material/FormControl';
import FormLabel from '@mui/material/FormLabel';
import Checkbox from '@mui/material/Checkbox';

function CategoryButtons2({filterCategory}) {
    const [booll,setBooll] = useState(true);

    function handleBooll() {
        setBooll(!booll);
    }
    return (
        <FormControl>
            <FormLabel>Brand</FormLabel>
            <div>
                <input type="checkbox" onClick={()=> {filterCategory("All")}} /> All
                <input type="checkbox" onClick={()=> {filterCategory("a")}} /> a
                <input type="checkbox" onClick={()=> {filterCategory("b")}} /> b
                <input type="checkbox" onClick={()=> {filterCategory("c")}} /> c
            </div>
      </FormControl>
    );
